package WrittenBasic;

public class EvenNUmberfrom121to229 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 121;
		int b = 229;
		System.out.println("even mumber 121 to 229");
		while (a <= b) {
			if (a % 2 == 0) {
				System.out.println(a);

			}
			a++;

		}

	}

}
